import React, { useState, useEffect } from "react";
import axios from "axios";
import { Card, Container } from "react-bootstrap";
import "./css/style.css";
function Apidata() {
  const [value, setValue] = useState([]);

  useEffect(() => {
    handleData();
  }, []);

  const handleData = async () => {
    try {
      await axios
        .get(
          "https://api.openweathermap.org/data/2.5/weather?q=mohali&units=metric&appid=effecea7baccf16912338e128c2f0bf8"
        )
        .then((result) => {
          console.log(result.data.main);
          setValue(result.data.main);
        });
    } catch (error) {
      console.log("api error", error);
    }
  };
  return (
    <>
      <h1>Weather Data</h1>
      <div class="card">
        <div class="container">
          <input type="search" />
        </div>
      </div>
      <div>
        <h4>{value.temp}</h4>
      </div>
    </>
  );
}

export default Apidata;
